function getRandomInteger(e,o){e=e-.5+Math.random()*(o-e+1);return Math.round(e)}function bubbleSort(o){console.log(o),document.querySelector("#outBefore").innerHTML=o;for(let e=0;e<o.length;e++)for(let e=0;e<o.length-1;e++){var t;o[e]>o[e+1]&&(t=o[e],o[e]=o[e+1],o[e+1]=t)}}document.querySelector("#sortByMaxButton").onclick=function(){let o=document.querySelector("#length").value,t=document.querySelector("#min").value,n=document.querySelector("#max").value,r=[];for(let e=0;e<o;e++)r.push(getRandomInteger(t,n));return bubbleSort(r),console.log(r),document.querySelector("#outAfter").innerHTML=r,r},document.querySelector("#sortByMinButton").onclick=function(){let o=document.querySelector("#length").value,t=document.querySelector("#min").value,n=document.querySelector("#max").value,r=[];for(let e=0;e<o;e++)r.push(getRandomInteger(t,n));return function(t){console.log(t),document.querySelector("#outBefore").innerHTML=t;for(let o=0;o<t.length-1;o++)for(let e=o+1;e<t.length;e++){var n;t[o]<t[e]&&(n=t[e],t[e]=t[o],t[o]=n)}}(r),console.log(r),document.querySelector("#outAfter").innerHTML=r,r},document.querySelector("#sumOfSquaresOfOddNumbersButton").onclick=function(){let o=document.querySelector("#length").value,t=document.querySelector("#min").value,n=document.querySelector("#max").value,r=[];for(let e=0;e<o;e++)r.push(getRandomInteger(t,n));let u=0;return function(o){console.log(o),document.querySelector("#outBefore").innerHTML=o;for(let e=0;e<o.length;e++)o[e]%2!=0&&(u+=o[e]*o[e]);console.log(o)}(r),console.log(u),document.querySelector("#outAfter").innerHTML=u,r};